        IdentityHashMap<String, Integer> map = new IdentityHashMap<>();

        // Add some initial mappings
        map.put("Initial", 1);
        map.put("Dummy", 2);

        // Create some unrelated computations
        int randomValue = 9876 * 5432 + 123 - 789;
        String key = "A";
        if (randomValue % 2 == 0) {
