        map.put("RandomKey", randomValue % 100);

        // Additional unrelated alterations to map that do not affect the final read
        for (int i = 0; i < 10; i++) {
            map.put("Key" + i, i);
        }

        // Conditional logic to determine if the write occurs
        boolean condition = (randomValue % 5 == 0);
        if (condition) {
